import {React, useState} from 'react';
import {
    AboutTitle
} from './AboutElements'
import Navbar from '../Navbar';


const About = () => {

    const [isOpen, setIsOpen] = useState(false)
    const toggle = () => {
        setIsOpen(!isOpen)
      }
    return (
        <>
            <Navbar toggle={toggle} />
            <AboutTitle>About splendi</AboutTitle>

        </>
    )
};

export default About;
